import React from "react";
import { Button } from "../../globalStyles";
import {
  FaFacebook,
  FaInstagram,
  FaYoutube,
  FaTwitter,
  FaLinkedin
} from "react-icons/fa";
import {
  FooterContainer,
  FooterSubscription,
  FooterSubText,
  FooterSubHeading,
  Form,
  FormInput,
  FooterLinksContainer,
  FooterLinksWrapper,
  FooterLinkItems,
  FooterLinkTitle,
  FooterLink,
  SocialMedia,
  SocialMediaWrap,
  SocialLogo,
  SocialIcon,
  WebsiteRights,
  SocialIcons,
  SocialIconLink,
  FooterDescription,
  FooterLinkTitleLocality
} from "./Footer.elements";

import { NavLogoLakaters } from "../Navbar/Navbar.elements";

function Footer() {
  return (
    <div>
      <div
        style={{
          display: "flex",
          flexDirection: "row",
          justifyContent: "center"
        }}
      >
        <div style={{ marginRight: 100, marginBottom: 50 }}>
          <div>
            <FooterLinkTitleLocality style={{ justifyContent: "flex-start" }}>
              Addresss
            </FooterLinkTitleLocality>
            104, Crescent Heights, Kismathpur,<br></br> Hyderabad, Telengana,
            500030.
          </div>
        </div>
        <div>
          <FooterLinkTitleLocality style={{ justifyContent: "flex-start" }}>
            CONTACT US
