          <FooterLinkItems style={{ justifyContent: "flex-start" }}>
            <a href="tel:+91 7207724191">7207724191</a>
            <a href="mailto:lakaters.hyd@gmail.com">lakaters.hyd@gmail.com</a>
          </FooterLinkItems>
        </div>
      </div>

      <div
        style={{
          display: "flex",
          flexDirection: "row",
          justifyContent: "center",
