          <SocialIconLink href="/" target="_blank" aria-label="Twitter">
            <FaTwitter />
          </SocialIconLink>
          <SocialIconLink href="/" target="_blank" aria-label="LinkedIn">
            <FaLinkedin />
          </SocialIconLink>
        </SocialIcons>
        {/* </SocialMediaWrap> */}
        {/* </SocialMedia> */}
      </div>
      <div
        style={{
          display: "flex",
          flexDirection: "row",
          justifyContent: "center",
          marginBottom: 50
        }}
      >
        <SocialIconLink
          href="/privacy-policy"
          style={{ marginRight: 10, fontSize: 14 }}
        >
          Privacy Policy
        </SocialIconLink>
        <WebsiteRights>Lakaters Â© 2021</WebsiteRights>
      </div>
    </div>

    // <FooterContainer>
